    },{
        id:4,heading:"Quality Assurance",Content:"lorem dbvdkvbd dkjbdvbdvsvhsdvhdvbhdv  dbvhbdvdsbv bdvbdsvbsdv  bdujbdj",status:false
    }])
  return (
    <div>
       <div className="hover">
          <div className="Hovercontent">
              <div className="content">
                 {data && data.map(el=>(
                    <div className='elements'>
                        <h3>{el.heading}</h3>
                        {el.status && <p>{el.Content}</p>}
                        </div>
                 ))}
              </div>
          </div>
       </div>
    </div>
  )
}

export default Homepagehover
